package com.ahyar.diramut;

import android.content.ContentValues;
import android.content.Context;
import android.database.sqlite.SQLiteDatabase;
import android.database.sqlite.SQLiteOpenHelper;

public class DataHelper extends SQLiteOpenHelper {

    public static final String DB_NAME = "contacts.db";
    public static final String TABLE_NAME = "CONTACTS";
    public static final int DB_VERSION = 3;

    public static final String COLUMN_1 = "ID";
    public static final String COLUMN_2 = "NMPENYAKIT";
    public static final String COLUMN_3 = "DESKRIPSI";
    public static final String COLUMN_4 = "GEJALA";
    public static final String COLUMN_5 = "SOLUSI";
    public static final String COLUMN_6 = "IMAGE";
    public static final String QUERY_CREATE = "CREATE TABLE "+TABLE_NAME+" ("
            +COLUMN_1+" INTEGER PRIMARY KEY AUTOINCREMENT, "
            +COLUMN_2+" TEXT, "
            +COLUMN_3+" TEXT, "
            +COLUMN_4+" TEXT, "
            +COLUMN_5+" TEXT, "
            +COLUMN_6+" TEXT)";




    public DataHelper(Context context, String name, SQLiteDatabase.CursorFactory factory, int version) {
        super(context, DB_NAME, null, DB_VERSION);
    }

    @Override
    public void onCreate(SQLiteDatabase db) {
        db.execSQL(QUERY_CREATE);
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Cacingan','Kucing terinfeksi oleh cacing internal atau parasit dalam saluran pencernaan mereka. Cacing pada kucing dapat berasal dari berbagai jenis cacing, termasuk cacing gilik (Toxocara cati), cacing tambang (Ancylostoma tubaeforme), dan cacing pita (Dipylidium caninum).','1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tSering bab\n" +
                "4.\tDiare\n" +
                "5.\tPenurunan berat badan\n" +
                "6.\tGatal sekitar Anus\n" +
                "7.\tMata Berair\n" +
                "8.\tBelekan\n','Kalau masih aktif bisa dikasih obat cacing, tetapi apabila lemas dianjurkan dibawa keklinik','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Jamuran','Jamur pada kucing dapat disebabkan oleh berbagai jenis jamur, seperti Microsporum canis, Trichophyton mentagrophytes, dan Malassezia pachydermatis. Jamur poda pada kucing adalah jenis infeksi jamur yang disebabkan oleh Malassezia pachydermatis. Jamur poda pada kucing dapat menyebabkan infeksi kulit dan telinga,','1.\tBulu Kusam\n" +
                "2.\tLuka-luka pada kulit tidak simetris dan berbntuk bulat\n','Mandi anti jamur, dan minum obat anti jamur (Dibawah pengawasan dokter)','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Kutuan','Kutuan pada kucing disebabkan oleh serangan kutu yang hidup di bulu kucing. Kutu pada kucing dapat membawa telur cacing pita yang dapat menimbulkan infeksi cacing pada kucing.','1.\tBulu Kusam\n" +
                "2.\tBulu rontok hingga kebotakan\n" +
                "3.\tLuka-luka didareah tengkuk, leher dan kepala\n" +
                "4.\tLuka-luka pada kulit simetris dan berbntuk bulat\n','Tetes kutu dan flea control','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Gangguan Liver','Gangguan hati atau liver pada kucing dapat disebabkan oleh berbagai faktor, seperti keracunan, infeksi, dan penyakit hati seperti lipidosis hati atau hati berlemak. ','1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tDiare\n" +
                "4.\tBulu Kusam\n" +
                "5.\tJaundis atau kuning ditelinga\n" +
                "6.\tMata berubah warna\n" +
                "7.\tGusi kekuningan\n" +
                "8.\tDehidrasi\n','Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Virus rhinotracheitis','Virus rhinotracheitis pada kucing adalah infeksi saluran pernapasan atau paru-paru yang disebabkan oleh Felid alphaherpesvirus 1 (FeHV-1) dari keluarga Herpesviridae. ','1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tDemam\n" +
                "4.\tDehidrasi\n" +
                "5.\tFlu\n" +
                "6.\tBersin-bersin\n" +
                "7.\tSesak\n" +
                "8.\tBatuk-batuk\n','Apabila Flu dan masih nafsu makan bisa rawat jalan','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Virus calisi','Virus calici pada kucing atau feline calicivirus adalah patogen virus yang menyebabkan infeksi saluran pernapasan atas pada kucing. Virus ini biasanya menyerupai flu dan dapat menyerang sistem pernapasan, mulut, dan persendian kucing. Virus calici pada kucing dapat menyebar melalui sekresi hidung, mulut, dan mata, serta melalui kontak dengan objek yang telah terkontaminasi.','1.\tTidak nafsu makan\n" +
                "2.\tLesu\n" +
                "3.\tDemam\n" +
                "4.\tBersin-bersin\n" +
                "5.\tSariwan\n" +
                "6.\tSering keluar air liur\n" +
                "7.\tInfeksi telinga\n" +
                "8.\tLumpuh tiba-tiba\n" +
                "9.\tBatuk-batuk\n','Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','')");
        db.execSQL("INSERT INTO CONTACTS (NMPENYAKIT,DESKRIPSI,GEJALA,SOLUSI,IMAGE) VALUES ('Virus panleukopenia','Virus panleukopenia pada kucing atau Feline Panleukopenia Virus (FPV) adalah penyakit virus yang sangat menular dan berpotensi fatal yang menyerang kucing. Virus ini disebabkan oleh feline parvovirus (FPV) dan biasanya menyerang anak kucing serta kucing yang belum divaksin. Virus ini dapat menginfeksi dan merusak organ tubuh kucing, seperti sumsum tulang, usus, dan kulit. Virus panleukopenia juga bisa menyerang janin kucing pada kucing yang hamil. Virus panleukopenia dapat hidup lama dan ditemukan di berbagai tempat, misalnya mangkuk makan kucing, kotak pasir, kandang, tempat bermain, dan tempat tidurnya.','1.\tMuntah\n" +
                "2.\tTidak nafsu makan\n" +
                "3.\tLesu\n" +
                "4.\tDehidrasi\n','Dianjurkan langsung dibawah ke klinik, untuk pemerikasaan lebih lanjut dan treatmen lebih lanjut','')");

    }



    @Override
    public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
        db.execSQL("DROP TABLE IF EXISTS "+TABLE_NAME);
        onCreate(db);
    }


    public void insertData(ContentValues values){
        getWritableDatabase().insert(TABLE_NAME, null, values);
    }


}